import axios from 'axios'

const EMPLOYEES_REST_API_URL="http://localhost:26789/api/v1/employees";

class EmployeeService {
    getEmployees() {
        return axios.get(EMPLOYEES_REST_API_URL);
    }
}

export default new EmployeeService()
